import React from 'react';
import { Link } from 'react-router-dom';

const DUMMY_EVENTS = [
    {
        id: "e1",
        title: "Some events"
    },
    {
        id: "e2",
        title: "Another event"
    }
]

const Events = () => {
    return (
        <>
            <div>Events</div>
            {
                DUMMY_EVENTS.map((event) => {
                    return <Link key={event.id} to= {`/events/${event.id}`}>{event.title}</Link>
                })
            }
        </>
    )
}

export default Events
